import React from 'react';
import './About.css';
export default function About(){
    return(
        <>
        <div className="ab">
             <h2 className="ab-name">कन्या  उ. मा.  विद्यालय</h2>
             <h3 className="ab-des"> From Class 6th to class 10th <br />
             Recognized by Uttar Pradesh Government </h3>
             <div className="people">
                <h3>Director : Niyajuddin Ansari  [Mo.No. - 9984950054 | 8948302975] </h3>
                <h3>Principle : Najma Nesha (M.A. | B-Ed)</h3>
                <h3>Vice Principle : Khaliq Ansari (M.A. | D.L-Ed)</h3>
             </div>
        </div>
        </>
    )
}
